import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3.17 3.97C2.52 3.97 2 4.49 2 5.14V10a6 6 0 0011.92 1H15a3 3 0 100-6h-1a1.17 1.17 0 00-1.17-1.03H3.17zM3 5.14c0-.1.08-.17.17-.17h9.66c.1 0 .17.07.17.17V10a5 5 0 01-10 0V5.14zM14 6h1a2 2 0 110 4h-1V6z", fill: primaryFill }));
};
const DrinkCoffee20Regular = wrapIcon(rawSvg({}), 'DrinkCoffee20Regular');
export default DrinkCoffee20Regular;
